import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import SignUp from './signup';
import LogIn from './login';
import { Navbar, Button } from 'react-bootstrap';
import './component.css';
import NavBar from './navbar';

class LoggedOutNavbar extends Component{

    state = {
        signup: true
    }

    clickSignUp = (e) => {
        e.preventDefault();
        this.setState({ signup: true });
      }

    clickLogIn = (e) => {
        e.preventDefault();
        this.setState({ signup : false });
      }

    render() {
        return(

              <div style={{position: "relative"}}>
                <div className="sign_up_container">


              { this.state.signup ? <SignUp /> : <LogIn />}


                <Button variant={this.state.signup === true ? "success" : "light"} onClick={this.clickSignUp}>New to the site?</Button>
                <Button variant={this.state.signup === false ? "success" : "light"} onClick={this.clickLogIn}>Already have an account?</Button>

            </div>
            </div>
        )
    }
}

//<div className={this.state.signup ? "sign_up_container" : "log_in_container"}></div>

export default LoggedOutNavbar;
